import React from 'react'

const Test = () => {
    const Click = (id: string) => {
        const ip: any = document.getElementById('a')
        const text: any = document.getElementById(id)
        ip.innerText = text.innerText
        return (
            <div>
                <form >
                    <input id='a' type="text " value={'tất cả'}></input>
                    <div onClick={() => Click('a')}>
                        <p id='a'>nguyen duy duc</p>
                    </div>
                </form>
            </div>
        )
    }
}

export default Test;
